  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144250 includes Surface
  underway data collected from MIRAI in the Indian Ocean, Mozambique Channel and South
  Atlantic Ocean from 2003-12-09 to 2004-01-24. These data include AIR TEMPERATURE,
  BAROMETRIC PRESSURE, Partial pressure (or fugacity) of carbon dioxide - atmosphere,
  Partial pressure (or fugacity) of carbon dioxide - water, SALINITY, SEA SURFACE
  TEMPERATURE, WIND DIRECTION and WIND SPEED. The instruments used to collect these
  data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
  for autonomous carbon dioxide (CO2) measurement.nnThese data were collected by Akihiko
  Murata of Japan Agency for Marine-Earth Science and Technology (JAMSTEC) as part
  of the CLIVAR_I03I04_2003_Underway data set. CDIAC associated the following cruise
  ID(s) with this data set: 49NZ20031209nnThe Global Volunteer Observing Ship (VOS)
  Program is coordinated by the UNESCO International Ocean Carbon Coordination Project
  (IOCCP). International groups from 14 countries have been outfitting research ships
  and commercial vessels with automated CO2 sampling equipment to analyze the carbon
  exchange between the ocean and atmosphere.\",\n\t\"license_title\": null,\n\t\"extras\":
